import React from "react";

const CharacterCard = props => {
  console.log(props.item.image);
  return (
    <li className="card">
      <img className="card-img"></img>
      <h4 className="card_title"></h4>
      <p className="card_name"></p>
    </li>
  );
};

export default CharacterCard;
